  "privacy-content": "<bold>\n<20>Politique de confidentialité\n\n\n\nPolitique de confidentialité pour les outils Instadp </20>\n</bold>\n\n <16> Aux outils Instadp, accessibles à partir d'Instadptools.com, l'une de nos principales priorités est l'intimité de nos visiteurs. Ce document de politique de confidentialité contient des types d'informations collectées et enregistrées par les outils Instadp et comment nous les utilisons.\n\nSi vous avez des questions supplémentaires ou avez besoin de plus d'informations sur notre politique de confidentialité, n'hésitez pas à nous contacter.\n\nCette politique de confidentialité s'applique uniquement à nos activités en ligne et est valable pour les visiteurs de notre site Web en ce qui concerne les informations qu'ils ont partagées et / ou collectées dans les outils Instadp. Cette politique ne s'applique pas à toute information collectée hors ligne ou via des canaux autres que ce site Web. Notre politique de confidentialité a été créée à l'aide du générateur de politique de confidentialité H-Supertools.\n\n</16> <bold>\n<20> Consentement </20>\n\n</bold> <16> En utilisant notre site Web, vous consentez par la présente à notre politique de confidentialité et acceptez ses conditions. </16>\n\n<bold>\n<20> Informations que nous collectons\n\n</20>\n</bold> <16> Les informations personnelles que l'on vous demande de fournir, et les raisons pour lesquelles vous êtes invité à les fournir vous seront clairement indiquées au moment où nous vous demandons de fournir vos informations personnelles.\n\nSi vous nous contactez directement, nous pouvons recevoir des informations supplémentaires vous concernant, comme votre nom, votre adresse e-mail, le numéro de téléphone, le contenu du message et / ou des pièces jointes que vous pouvez nous envoyer, et toute autre information que vous pouvez choisir de fournir.\n\nLorsque vous vous inscrivez à un compte, nous pouvons demander vos coordonnées, y compris des éléments tels que le nom, le nom de l'entreprise, l'adresse, l'adresse e-mail et le numéro de téléphone.\n\n</16> <bold>\n<20> Comment nous utilisons vos informations </20>\n</bold> <16> Nous utilisons les informations que nous collectons de diverses manières, notamment à:\n - Fournir, exploiter et maintenir notre site Web.\n  - Améliorez, personnalisez et élargissez notre site Web.\n  - Comprendre et analyser comment vous utilisez notre site Web.\n  - Développer de nouveaux produits, services, fonctionnalités et fonctionnalités.\n  - Communiquez avec vous, directement ou par le biais de l'un de nos partenaires, y compris pour le service client, pour vous fournir des mises à jour et d'autres informations relatives au site Web, et à des fins de marketing et de promotion.\n  - vous envoyer des e-mails.\n  - trouver et prévenir la fraude. </16> <bold>\n<20>\nFichiers journaux </20>\n</bold> <16> Les outils Instadp suivent une procédure standard d'utilisation des fichiers journaux. Ces fichiers enregistrent les visiteurs lorsqu'ils visitent les sites Web. Toutes les sociétés d'hébergement font cela et une partie de l'analyse des services d'hébergement. Les informations collectées par les fichiers journaux incluent les adresses de protocole Internet (IP), le type de navigateur, le fournisseur de services Internet (ISP), la date et l'horodatage, les pages de référence / sortie, et éventuellement le nombre de clics. Ceux-ci ne sont liés à aucune information personnellement identifiable. Le but de l'information est d'analyser les tendances, d'administrer le site, de suivre le mouvement des utilisateurs sur le site Web et de recueillir des informations démographiques.\n</16> <bold>\n<20> Cookies and Web Balise </20>\n</bold> <16>\nComme tout autre site Web, Instadp Tools utilise des «cookies». Ces cookies sont utilisés pour stocker des informations, y compris les préférences des visiteurs et les pages du site Web auquel le visiteur a accédé ou visité. Les informations sont utilisées pour optimiser l'expérience des utilisateurs en personnalisant le contenu de notre page Web en fonction du type de navigateur des visiteurs et / ou d'autres informations.\n</16> <bold>\n<20> Google DoubleClick Dart Cookie </20>\n</bold> <16>\nGoogle est l'un des fournisseurs tiers sur notre site. Il utilise également des cookies, appelés cookies DART, pour diffuser des annonces aux visiteurs de notre site en fonction de leur visite sur www.website.com et d'autres sites sur Internet. Cependant, les visiteurs peuvent choisir de refuser l'utilisation des cookies DART en visitant la politique de confidentialité de Google AD et Content Network à l'URL suivante - https://polices.google.com/technologies/ads.\n</16> <bold>\n<20> Nos partenaires publicitaires </20>\n</bold> <16>\nCertains annonceurs de notre site peuvent utiliser des cookies et des balises Web. Nos partenaires publicitaires sont répertoriés ci-dessous. Chacun de nos partenaires publicitaires a sa propre politique de confidentialité pour ses politiques sur les données des utilisateurs. Pour un accès plus facile, nous avons lié à leurs politiques de confidentialité ci-dessous.\n  -    Google.\n</16> <bold>\n<20> Politiques de confidentialité des partenaires publicitaires </20>\n</bold> <16>\nVous pouvez consulter cette liste pour trouver la politique de confidentialité pour chacun des partenaires publicitaires des outils Instadp. Des serveurs publicitaires tiers ou des réseaux publicitaires utilisent des technologies comme les cookies, JavaScript ou les balises Web qui sont utilisées dans leurs publicités et liens respectifs qui apparaissent sur les outils Instadp, qui sont envoyés directement au navigateur des utilisateurs. Ils reçoivent automatiquement votre adresse IP lorsque cela se produit. Ces technologies sont utilisées pour mesurer l'efficacité de leurs campagnes publicitaires et / ou pour personnaliser le contenu publicitaire que vous voyez sur les sites Web que vous visitez. Notez que les outils Instadp n'ont pas accès ou